// eslint-disable-next-line
import React,{useState} from "react";
import  { Navigate }  from "react-router-dom"
import axios from "axios";
import "./pageLogin.css"
function Login() {

const [user,setUser]=useState({
  email:"",
  password:""
})

function handleChange(event){
  const newuser={...user}
  newuser[event.target.id]=event.target.value
  setUser(newuser)
 // console.log(newuser);
}

/*function handleClick(event){
  event.preventDefault();
  axios.post("https://clubs-united.herokuapp.com/register",user)
  .then(res=>{
    //console.log(res)
    alert("Query Submitted "+user.name);
  })
  
}*/

return (
    <div className="container contact-top logincolor">
      
      <h1 className="text-center">Sign</h1>
      <div className="form1 fluid-container">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto">
            <form>
              <div className="form-group">
                <label>Email id</label>
                <input
                  type="email"
                  id="email"
                  value={user.email}
                  className="form-control"
                  placeholder="Email"
                  name="email"
                  onChange={handleChange}
                />
                <label for="exampleInputEmail1">Password</label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  name="password"
                  value={user.password}
                  placeholder="Password"
                  onChange={handleChange}
                />
              </div>
              <button type="submit" className="btn btn-primary last">
                Submit
              </button>
            </form>
          </div>
        </div>
        <footer className="foot text-center">
          <p>Â© Copyright 2022 Clubs United</p>
          <p>
            Made with <i className="fa-solid fa-heart"></i> by Gaurav Ahuja
          </p>
        </footer>
      </div>
    </div>
  );              
}
export default Login;
